import './App.css';
import Navbar from './components/Navbar';
import Main from './components/Main';





const App = () => {
  const products = [
    {
      id: 1,
      url: '/images/product-1.png',
      name: 'Brown eggs',
      description: 'Raw organic brown eggs in a basket',
      category: 'dairy',
      price: 'Rs. 100',
      rating: 4.5
    },
    {
      id: 2,
      url: '/images/product-2.png',
      name: 'Sweet fresh stawberry',
      description: 'Sweet fresh stawberry on the wooden table',
      category: 'fruit',
      price: 'Rs. 150',
      rating: 4.8
    },
    {
      id: 4,
      url: "/images/orange.png",
      name: "Fresh orange",
      description: "Fresh orange juice on a white background",
      category: "fruit",
      price: "Rs.200",
      rating: 4.6
    },

    {
      id: 5,
      url: "/images/yogurt.png",
      name: "Strawberry yogurt",
      description: "Strawberry yogurt with granola and berries",
      category: "dairy",
      price: "",
      rating: 4.4
    },

    {
      id: 6,
      url: "/images/product-veg1.png",
      name: "Organic tomato",
      description: "Organic tomato on a cutting board",
      category: "vegetables",
      price: "$9",
      rating: 4.6
    },
    {
      id: 7,
      url: "/images/product-veg.png",
      name: "Basil",
      description: "Fresh basil leaves on a white background",
      category: "vegetables",
      price: "$4",
      rating: 4.5
    }

  ];


  return (
    <div className="App">

      <Navbar />
      <div className="App">
        <Main products={products} />
      </div>


      {/* <Footer/> */}
    </div>
  );
};

export default App;
